// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title FlowActions
 * @dev Composable transaction workflows with connectors and actions
 * Based on Flow's Forte Flow Actions pattern for building complex DeFi workflows
 */
contract FlowActions is Ownable, ReentrancyGuard {

    // Enums
    enum ActionType {
        Transfer,      // Simple token transfer
        Swap,          // Token swap
        Stake,         // Stake tokens
        Lend,          // Lend tokens
        Borrow,        // Borrow tokens
        Custom         // Custom action via contract call
    }

    enum WorkflowStatus {
        Pending,
        Executing,
        Completed,
        Failed,
        Cancelled
    }

    // Structs
    struct Action {
        ActionType actionType;
        address target;        // Target contract
        bytes data;            // Encoded function call
        uint256 value;         // ETH value
        string description;
    }

    struct Workflow {
        uint256 id;
        address creator;
        Action[] actions;
        WorkflowStatus status;
        uint256 createdAt;
        uint256 executedAt;
        string name;
        bool allowPartialFailure;
    }

    struct WorkflowResult {
        uint256 workflowId;
        bool success;
        uint256 completedActions;
        bytes[] results;
    }

    // State variables
    uint256 public nextWorkflowId = 1;
    mapping(uint256 => Workflow) public workflows;
    mapping(address => uint256[]) public userWorkflows;
    mapping(bytes32 => bool) public registeredConnectors;

    // Events
    event WorkflowCreated(uint256 indexed workflowId, address indexed creator, string name);
    event WorkflowExecuted(uint256 indexed workflowId, bool success, uint256 actionsCompleted);
    event WorkflowCancelled(uint256 indexed workflowId);
    event ActionExecuted(uint256 indexed workflowId, uint256 actionIndex, bool success);
    event ConnectorRegistered(bytes32 indexed connectorHash, string name);

    constructor() Ownable(msg.sender) {}

    /**
     * @dev Create a new workflow with multiple actions
     * @param actions Array of actions to execute
     * @param name Human-readable workflow name
     * @param allowPartialFailure Whether to continue if an action fails
     * @return workflowId Unique workflow identifier
     */
    function createWorkflow(
        Action[] calldata actions,
        string calldata name,
        bool allowPartialFailure
    ) public returns (uint256 workflowId) {
        require(actions.length > 0, "No actions provided");
        require(actions.length <= 20, "Too many actions (max 20)");

        workflowId = nextWorkflowId++;

        Workflow storage workflow = workflows[workflowId];
        workflow.id = workflowId;
        workflow.creator = msg.sender;
        workflow.status = WorkflowStatus.Pending;
        workflow.createdAt = block.timestamp;
        workflow.name = name;
        workflow.allowPartialFailure = allowPartialFailure;

        // Copy actions
        for (uint256 i = 0; i < actions.length; i++) {
            workflow.actions.push(actions[i]);
        }

        userWorkflows[msg.sender].push(workflowId);

        emit WorkflowCreated(workflowId, msg.sender, name);

        return workflowId;
    }

    /**
     * @dev Execute a workflow
     * @param workflowId Workflow ID to execute
     * @return result WorkflowResult with execution details
     */
    function executeWorkflow(uint256 workflowId)
        public
        payable
        nonReentrant
        returns (WorkflowResult memory result)
    {
        Workflow storage workflow = workflows[workflowId];

        require(workflow.id != 0, "Workflow does not exist");
        require(workflow.creator == msg.sender, "Not workflow creator");
        require(workflow.status == WorkflowStatus.Pending, "Workflow not pending");

        workflow.status = WorkflowStatus.Executing;

        result.workflowId = workflowId;
        result.results = new bytes[](workflow.actions.length);
        result.completedActions = 0;
        result.success = true;

        // Execute each action in sequence
        for (uint256 i = 0; i < workflow.actions.length; i++) {
            Action memory action = workflow.actions[i];

            (bool success, bytes memory returnData) = action.target.call{
                value: action.value
            }(action.data);

            result.results[i] = returnData;

            if (success) {
                result.completedActions++;
                emit ActionExecuted(workflowId, i, true);
            } else {
                emit ActionExecuted(workflowId, i, false);

                if (!workflow.allowPartialFailure) {
                    result.success = false;
                    workflow.status = WorkflowStatus.Failed;
                    emit WorkflowExecuted(workflowId, false, result.completedActions);
                    return result;
                }

                result.success = false;
            }
        }

        workflow.status = result.success ? WorkflowStatus.Completed : WorkflowStatus.Failed;
        workflow.executedAt = block.timestamp;

        emit WorkflowExecuted(workflowId, result.success, result.completedActions);

        return result;
    }

    /**
     * @dev Create and immediately execute a workflow
     * @param actions Array of actions
     * @param name Workflow name
     * @param allowPartialFailure Allow partial failures
     * @return result Workflow execution result
     */
    function createAndExecuteWorkflow(
        Action[] calldata actions,
        string calldata name,
        bool allowPartialFailure
    ) external payable nonReentrant returns (WorkflowResult memory result) {
        require(actions.length > 0, "No actions provided");
        require(actions.length <= 20, "Too many actions (max 20)");

        uint256 workflowId = nextWorkflowId++;

        Workflow storage workflow = workflows[workflowId];
        workflow.id = workflowId;
        workflow.creator = msg.sender;
        workflow.status = WorkflowStatus.Executing;
        workflow.createdAt = block.timestamp;
        workflow.name = name;
        workflow.allowPartialFailure = allowPartialFailure;

        // Copy actions
        for (uint256 i = 0; i < actions.length; i++) {
            workflow.actions.push(actions[i]);
        }

        userWorkflows[msg.sender].push(workflowId);

        emit WorkflowCreated(workflowId, msg.sender, name);

        // Execute immediately
        result.workflowId = workflowId;
        result.results = new bytes[](workflow.actions.length);
        result.completedActions = 0;
        result.success = true;

        // Execute each action in sequence
        for (uint256 i = 0; i < workflow.actions.length; i++) {
            Action memory action = workflow.actions[i];

            (bool success, bytes memory returnData) = action.target.call{
                value: action.value
            }(action.data);

            result.results[i] = returnData;

            if (success) {
                result.completedActions++;
                emit ActionExecuted(workflowId, i, true);
            } else {
                emit ActionExecuted(workflowId, i, false);

                if (!workflow.allowPartialFailure) {
                    result.success = false;
                    workflow.status = WorkflowStatus.Failed;
                    emit WorkflowExecuted(workflowId, false, result.completedActions);
                    return result;
                }

                result.success = false;
            }
        }

        workflow.status = result.success ? WorkflowStatus.Completed : WorkflowStatus.Failed;
        workflow.executedAt = block.timestamp;

        emit WorkflowExecuted(workflowId, result.success, result.completedActions);

        return result;
    }

    /**
     * @dev Cancel a pending workflow
     * @param workflowId Workflow ID
     */
    function cancelWorkflow(uint256 workflowId) external {
        Workflow storage workflow = workflows[workflowId];

        require(workflow.id != 0, "Workflow does not exist");
        require(workflow.creator == msg.sender, "Not workflow creator");
        require(workflow.status == WorkflowStatus.Pending, "Workflow not pending");

        workflow.status = WorkflowStatus.Cancelled;

        emit WorkflowCancelled(workflowId);
    }

    /**
     * @dev Register a connector for reusable actions
     * @param connectorName Connector name
     * @param connectorAddress Connector contract address
     */
    function registerConnector(
        string calldata connectorName,
        address connectorAddress
    ) external onlyOwner {
        bytes32 connectorHash = keccak256(abi.encodePacked(connectorName, connectorAddress));
        registeredConnectors[connectorHash] = true;

        emit ConnectorRegistered(connectorHash, connectorName);
    }

    /**
     * @dev Quick action: Swap and Stake
     * @param swapTarget Swap contract address
     * @param swapData Encoded swap function call
     * @param stakeTarget Stake contract address
     * @param stakeData Encoded stake function call
     * @return workflowId Created workflow ID
     */
    function quickSwapAndStake(
        address swapTarget,
        bytes calldata swapData,
        address stakeTarget,
        bytes calldata stakeData
    ) external payable returns (uint256 workflowId) {
        workflowId = nextWorkflowId++;

        Workflow storage workflow = workflows[workflowId];
        workflow.id = workflowId;
        workflow.creator = msg.sender;
        workflow.status = WorkflowStatus.Pending;
        workflow.createdAt = block.timestamp;
        workflow.name = "Swap and Stake";
        workflow.allowPartialFailure = false;

        // Add swap action
        workflow.actions.push(Action({
            actionType: ActionType.Swap,
            target: swapTarget,
            data: swapData,
            value: msg.value / 2,
            description: "Swap tokens"
        }));

        // Add stake action
        workflow.actions.push(Action({
            actionType: ActionType.Stake,
            target: stakeTarget,
            data: stakeData,
            value: msg.value / 2,
            description: "Stake tokens"
        }));

        userWorkflows[msg.sender].push(workflowId);

        emit WorkflowCreated(workflowId, msg.sender, "Swap and Stake");

        return workflowId;
    }

    /**
     * @dev Get workflow details
     * @param workflowId Workflow ID
     * @return id Workflow ID
     * @return creator Creator address
     * @return status Current status
     * @return actionsCount Number of actions
     * @return name Workflow name
     */
    function getWorkflow(uint256 workflowId)
        external
        view
        returns (
            uint256 id,
            address creator,
            WorkflowStatus status,
            uint256 actionsCount,
            string memory name
        )
    {
        Workflow storage workflow = workflows[workflowId];
        return (
            workflow.id,
            workflow.creator,
            workflow.status,
            workflow.actions.length,
            workflow.name
        );
    }

    /**
     * @dev Get action details from a workflow
     * @param workflowId Workflow ID
     * @param actionIndex Action index
     * @return action Action details
     */
    function getWorkflowAction(uint256 workflowId, uint256 actionIndex)
        external
        view
        returns (Action memory action)
    {
        require(workflows[workflowId].id != 0, "Workflow does not exist");
        require(actionIndex < workflows[workflowId].actions.length, "Invalid action index");

        return workflows[workflowId].actions[actionIndex];
    }

    /**
     * @dev Get all workflows for a user
     * @param user User address
     * @return workflowIds Array of workflow IDs
     */
    function getUserWorkflows(address user)
        external
        view
        returns (uint256[] memory workflowIds)
    {
        return userWorkflows[user];
    }

    /**
     * @dev Check if connector is registered
     * @param connectorName Connector name
     * @param connectorAddress Connector address
     * @return registered Whether connector is registered
     */
    function isConnectorRegistered(
        string calldata connectorName,
        address connectorAddress
    ) external view returns (bool registered) {
        bytes32 connectorHash = keccak256(abi.encodePacked(connectorName, connectorAddress));
        return registeredConnectors[connectorHash];
    }

    /**
     * @dev Receive ETH
     */
    receive() external payable {}

    /**
     * @dev Withdraw stuck ETH (only owner)
     */
    function withdrawETH() external onlyOwner {
        (bool success, ) = owner().call{value: address(this).balance}("");
        require(success, "Withdrawal failed");
    }
}

contracts/LendingProtocol.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

/**
 * @title LendingProtocol
 * @dev Decentralized lending and borrowing protocol with collateralization
 * Lend assets to earn interest, or borrow against collateral
 */
contract LendingProtocol is Ownable, ReentrancyGuard {
    using SafeERC20 for IERC20;

    // Constants
    uint256 public constant LIQUIDATION_THRESHOLD = 80; // 80% LTV
    uint256 public constant LIQUIDATION_PENALTY = 10; // 10% penalty
    uint256 public constant INTEREST_RATE_BASE = 5; // 5% base APR
    uint256 public constant SECONDS_PER_YEAR = 365 days;

    // Structs
    struct Pool {
        uint256 totalSupply;
        uint256 totalBorrowed;
        uint256 interestRate;
        uint256 lastUpdateTime;
        bool isActive;
    }

    struct UserDeposit {
        uint256 amount;
        uint256 shares;
        uint256 depositTime;
        uint256 interestEarned;
    }

    struct UserLoan {
        uint256 borrowedAmount;
        uint256 collateralAmount;
        uint256 borrowTime;
        uint256 interestAccrued;
        bool isActive;
    }

    // State variables
    mapping(address => Pool) public pools;
    mapping(address => mapping(address => UserDeposit)) public deposits; // token => user => deposit
    mapping(address => mapping(address => UserLoan)) public loans; // user => token => loan
    mapping(address => uint256) public collateralValues; // Simplified: 1:1 value for demo

    address[] public supportedTokens;
    uint256 public platformFeePercent = 1; // 1% platform fee

    // Events
    event Deposited(address indexed user, address indexed token, uint256 amount);
    event Withdrawn(address indexed user, address indexed token, uint256 amount, uint256 interest);
    event Borrowed(address indexed user, address indexed token, uint256 amount, uint256 collateral);
    event Repaid(address indexed user, address indexed token, uint256 amount, uint256 interest);
    event Liquidated(address indexed borrower, address indexed liquidator, uint256 amount);
    event PoolCreated(address indexed token, uint256 initialInterestRate);

    constructor() Ownable(msg.sender) {}

    /**
     * @dev Create a new lending pool for a token
     * @param token Token address
     * @param initialInterestRate Initial interest rate (in basis points, e.g., 500 = 5%)
     */
    function createPool(address token, uint256 initialInterestRate) external onlyOwner {
        require(token != address(0), "Invalid token");
        require(!pools[token].isActive, "Pool already exists");

        pools[token] = Pool({
            totalSupply: 0,
            totalBorrowed: 0,
            interestRate: initialInterestRate,
            lastUpdateTime: block.timestamp,
            isActive: true
        });

        supportedTokens.push(token);
        collateralValues[token] = 1 ether; // Set initial value (simplified 1:1 for demo)

        emit PoolCreated(token, initialInterestRate);
    }

    /**
     * @dev Deposit tokens to earn interest
     * @param token Token to deposit
     * @param amount Amount to deposit
     */
    function deposit(address token, uint256 amount) external nonReentrant {
        require(pools[token].isActive, "Pool not active");
        require(amount > 0, "Amount must be > 0");

        Pool storage pool = pools[token];
        UserDeposit storage userDeposit = deposits[token][msg.sender];

        // Update interest before deposit
        _updateInterest(token, msg.sender);

        // Transfer tokens from user
        IERC20(token).safeTransferFrom(msg.sender, address(this), amount);

        // Calculate shares
        uint256 shares;
        if (pool.totalSupply == 0) {
            shares = amount;
        } else {
            shares = (amount * pool.totalSupply) / (pool.totalSupply - pool.totalBorrowed);
        }

        userDeposit.amount += amount;
        userDeposit.shares += shares;
        userDeposit.depositTime = block.timestamp;

        pool.totalSupply += amount;
        pool.lastUpdateTime = block.timestamp;

        emit Deposited(msg.sender, token, amount);
    }

    /**
     * @dev Withdraw deposited tokens and earned interest
     * @param token Token to withdraw
     * @param amount Amount to withdraw (0 = withdraw all)
     */
    function withdraw(address token, uint256 amount) external nonReentrant {
        Pool storage pool = pools[token];
        UserDeposit storage userDeposit = deposits[token][msg.sender];

        require(userDeposit.amount > 0, "No deposit");

        // Update interest
        _updateInterest(token, msg.sender);

        uint256 withdrawAmount = amount == 0 ? userDeposit.amount : amount;
        require(withdrawAmount <= userDeposit.amount, "Insufficient balance");
        require(withdrawAmount <= pool.totalSupply - pool.totalBorrowed, "Insufficient liquidity");

        uint256 interest = userDeposit.interestEarned;

        userDeposit.amount -= withdrawAmount;
        pool.totalSupply -= withdrawAmount;

        // Reset interest
        userDeposit.interestEarned = 0;

        // Transfer tokens back
        IERC20(token).safeTransfer(msg.sender, withdrawAmount + interest);

        emit Withdrawn(msg.sender, token, withdrawAmount, interest);
    }

    /**
     * @dev Borrow tokens by providing collateral
     * @param token Token to borrow
     * @param amount Amount to borrow
     */
    function borrow(address token, uint256 amount) external payable nonReentrant {
        require(pools[token].isActive, "Pool not active");
        require(amount > 0, "Amount must be > 0");
        require(msg.value > 0, "Must provide collateral");

        Pool storage pool = pools[token];
        UserLoan storage loan = loans[msg.sender][token];

        // Check available liquidity
        require(amount <= pool.totalSupply - pool.totalBorrowed, "Insufficient liquidity");

        // Check collateral is sufficient (150% collateralization ratio)
        uint256 requiredCollateral = (amount * 150) / 100;
        require(msg.value >= requiredCollateral, "Insufficient collateral");

        loan.borrowedAmount += amount;
        loan.collateralAmount += msg.value;
        loan.borrowTime = block.timestamp;
        loan.isActive = true;

        pool.totalBorrowed += amount;

        // Transfer borrowed tokens to user
        IERC20(token).safeTransfer(msg.sender, amount);

        emit Borrowed(msg.sender, token, amount, msg.value);
    }

    /**
     * @dev Repay borrowed tokens
     * @param token Token to repay
     * @param amount Amount to repay (0 = repay all)
     */
    function repay(address token, uint256 amount) external nonReentrant {
        UserLoan storage loan = loans[msg.sender][token];

        require(loan.isActive, "No active loan");

        // Calculate accrued interest
        uint256 interest = _calculateLoanInterest(msg.sender, token);
        uint256 totalDebt = loan.borrowedAmount + interest;

        uint256 repayAmount = amount == 0 ? totalDebt : amount;
        require(repayAmount <= totalDebt, "Repay amount too high");

        // Transfer repayment from user
        IERC20(token).safeTransferFrom(msg.sender, address(this), repayAmount);

        Pool storage pool = pools[token];
        pool.totalBorrowed -= (repayAmount > loan.borrowedAmount ? loan.borrowedAmount : repayAmount);

        // Calculate collateral to return
        uint256 collateralReturn = (loan.collateralAmount * repayAmount) / totalDebt;

        loan.borrowedAmount -= (repayAmount > loan.borrowedAmount ? loan.borrowedAmount : repayAmount - interest);
        loan.collateralAmount -= collateralReturn;

        if (loan.borrowedAmount == 0) {
            loan.isActive = false;
            // Return remaining collateral
            if (loan.collateralAmount > 0) {
                (bool success, ) = msg.sender.call{value: loan.collateralAmount}("");
                require(success, "Collateral return failed");
                loan.collateralAmount = 0;
            }
        }

        emit Repaid(msg.sender, token, repayAmount, interest);
    }

    /**
     * @dev Liquidate an undercollateralized loan
     * @param borrower Borrower address
     * @param token Loan token
     */
    function liquidate(address borrower, address token) external nonReentrant {
        UserLoan storage loan = loans[borrower][token];

        require(loan.isActive, "No active loan");

        uint256 interest = _calculateLoanInterest(borrower, token);
        uint256 totalDebt = loan.borrowedAmount + interest;

        // Check if loan is undercollateralized
        uint256 currentLTV = (totalDebt * 100) / loan.collateralAmount;
        require(currentLTV >= LIQUIDATION_THRESHOLD, "Loan not liquidatable");

        Pool storage pool = pools[token];

        // Liquidator repays the debt
        IERC20(token).safeTransferFrom(msg.sender, address(this), totalDebt);

        pool.totalBorrowed -= loan.borrowedAmount;

        // Liquidator receives collateral + penalty
        uint256 liquidationReward = loan.collateralAmount;

        loan.borrowedAmount = 0;
        loan.collateralAmount = 0;
        loan.isActive = false;

        // Transfer collateral to liquidator
        (bool success, ) = msg.sender.call{value: liquidationReward}("");
        require(success, "Liquidation reward transfer failed");

        emit Liquidated(borrower, msg.sender, totalDebt);
    }

    /**
     * @dev Get user deposit info
     * @param token Token address
     * @param user User address
     * @return amount Deposited amount
     * @return interest Earned interest
     */
    function getUserDeposit(address token, address user)
        external
        view
        returns (uint256 amount, uint256 interest)
    {
        UserDeposit memory userDeposit = deposits[token][user];
        uint256 pendingInterest = _calculateDepositInterest(token, user);

        return (userDeposit.amount, userDeposit.interestEarned + pendingInterest);
    }

    /**
     * @dev Get user loan info
     * @param token Token address
     * @param user User address
     * @return borrowed Borrowed amount
     * @return collateral Collateral amount
     * @return interest Accrued interest
     */
    function getUserLoan(address token, address user)
        external
        view
        returns (uint256 borrowed, uint256 collateral, uint256 interest)
    {
        UserLoan memory loan = loans[user][token];
        uint256 accruedInterest = _calculateLoanInterest(user, token);

        return (loan.borrowedAmount, loan.collateralAmount, accruedInterest);
    }

    /**
     * @dev Get pool utilization rate
     * @param token Token address
     * @return utilization Utilization rate (0-100)
     */
    function getPoolUtilization(address token) external view returns (uint256 utilization) {
        Pool memory pool = pools[token];

        if (pool.totalSupply == 0) return 0;

        return (pool.totalBorrowed * 100) / pool.totalSupply;
    }

    /**
     * @dev Calculate deposit interest
     */
    function _calculateDepositInterest(address token, address user)
        internal
        view
        returns (uint256)
    {
        UserDeposit memory userDeposit = deposits[token][user];
        Pool memory pool = pools[token];

        if (userDeposit.amount == 0) return 0;

        uint256 timeElapsed = block.timestamp - userDeposit.depositTime;
        uint256 interest = (userDeposit.amount * pool.interestRate * timeElapsed) /
            (SECONDS_PER_YEAR * 10000);

        return interest;
    }

    /**
     * @dev Calculate loan interest
     */
    function _calculateLoanInterest(address user, address token)
        internal
        view
        returns (uint256)
    {
        UserLoan memory loan = loans[user][token];
        Pool memory pool = pools[token];

        if (!loan.isActive || loan.borrowedAmount == 0) return 0;

        uint256 timeElapsed = block.timestamp - loan.borrowTime;
        uint256 interest = (loan.borrowedAmount * pool.interestRate * timeElapsed) /
            (SECONDS_PER_YEAR * 10000);

        return interest + loan.interestAccrued;
    }

    /**
     * @dev Update interest for a user
     */
    function _updateInterest(address token, address user) internal {
        uint256 interest = _calculateDepositInterest(token, user);
        if (interest > 0) {
            deposits[token][user].interestEarned += interest;
            deposits[token][user].depositTime = block.timestamp;
        }
    }

    /**
     * @dev Get all supported tokens
     * @return tokens Array of supported token addresses
     */
    function getSupportedTokens() external view returns (address[] memory tokens) {
        return supportedTokens;
    }

    /**
     * @dev Receive ETH for collateral
     */
    receive() external payable {}

    /**
     * @dev Withdraw stuck ETH (only owner)
     */
    function withdrawETH() external onlyOwner {
        (bool success, ) = owner().call{value: address(this).balance}("");
        require(success, "Withdrawal failed");
    }
}

contracts/ScheduledTransactions.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title ScheduledTransactions
 * @dev Schedule transactions for future execution with time-locks
 * Based on Flow's Forte scheduled transactions pattern
 */
contract ScheduledTransactions is Ownable, ReentrancyGuard {

    // Enums
    enum ScheduleStatus {
        Pending,
        Executed,
        Cancelled,
        Failed
    }

    // Structs
    struct ScheduledTx {
        uint256 id;
        address creator;
        address target;
        uint256 value;
        bytes data;
        uint256 executeAfter;
        uint256 executeWindow;  // Time window in which tx can be executed
        ScheduleStatus status;
        string description;
        uint256 createdAt;
        uint256 executedAt;
    }

    // State variables
    uint256 public nextScheduleId = 1;
    uint256 public minDelay = 1 minutes;
    uint256 public maxDelay = 365 days;
    uint256 public defaultWindow = 7 days;

    mapping(uint256 => ScheduledTx) public scheduledTransactions;
    mapping(address => uint256[]) public userSchedules;

    // Events
    event TransactionScheduled(
        uint256 indexed scheduleId,
        address indexed creator,
        address target,
        uint256 executeAfter,
        string description
    );

    event TransactionExecuted(uint256 indexed scheduleId, bool success);
    event TransactionCancelled(uint256 indexed scheduleId);
    event TransactionFailed(uint256 indexed scheduleId, bytes reason);

    constructor() Ownable(msg.sender) {}

    /**
     * @dev Schedule a transaction for future execution
     * @param target Target contract address
     * @param value ETH value to send
     * @param data Encoded function call data
     * @param executeAfter Unix timestamp after which tx can be executed
     * @param executeWindow Time window for execution (0 = default)
     * @param description Human-readable description
     * @return scheduleId Unique identifier for the scheduled transaction
     */
    function scheduleTransaction(
        address target,
        uint256 value,
        bytes calldata data,
        uint256 executeAfter,
        uint256 executeWindow,
        string calldata description
    ) public payable returns (uint256 scheduleId) {
        require(target != address(0), "Invalid target");
        require(executeAfter > block.timestamp, "Execution time must be in future");
        require(
            executeAfter <= block.timestamp + maxDelay,
            "Execution time too far in future"
        );
        require(
            executeAfter >= block.timestamp + minDelay,
            "Execution time too soon"
        );
        require(msg.value >= value, "Insufficient ETH sent");

        if (executeWindow == 0) {
            executeWindow = defaultWindow;
        }

        scheduleId = nextScheduleId++;

        scheduledTransactions[scheduleId] = ScheduledTx({
            id: scheduleId,
            creator: msg.sender,
            target: target,
            value: value,
            data: data,
            executeAfter: executeAfter,
            executeWindow: executeWindow,
            status: ScheduleStatus.Pending,
            description: description,
            createdAt: block.timestamp,
            executedAt: 0
        });

        userSchedules[msg.sender].push(scheduleId);

        emit TransactionScheduled(
            scheduleId,
            msg.sender,
            target,
            executeAfter,
            description
        );

        return scheduleId;
    }

    /**
     * @dev Execute a scheduled transaction
     * @param scheduleId ID of the scheduled transaction
     * @return success Whether execution succeeded
     */
    function executeScheduledTransaction(uint256 scheduleId)
        external
        nonReentrant
        returns (bool success)
    {
        ScheduledTx storage schedule = scheduledTransactions[scheduleId];

        require(schedule.id != 0, "Schedule does not exist");
        require(schedule.status == ScheduleStatus.Pending, "Not pending");
        require(block.timestamp >= schedule.executeAfter, "Too early to execute");
        require(
            block.timestamp <= schedule.executeAfter + schedule.executeWindow,
            "Execution window expired"
        );

        // Anyone can execute, but only within the time window
        (bool execSuccess, bytes memory returnData) = schedule.target.call{
            value: schedule.value
        }(schedule.data);

        if (execSuccess) {
            schedule.status = ScheduleStatus.Executed;
            schedule.executedAt = block.timestamp;
            emit TransactionExecuted(scheduleId, true);
            return true;
        } else {
            schedule.status = ScheduleStatus.Failed;
            emit TransactionFailed(scheduleId, returnData);
            emit TransactionExecuted(scheduleId, false);
            return false;
        }
    }

    /**
     * @dev Cancel a scheduled transaction (only creator can cancel)
     * @param scheduleId ID of the scheduled transaction
     */
    function cancelScheduledTransaction(uint256 scheduleId) external {
        ScheduledTx storage schedule = scheduledTransactions[scheduleId];

        require(schedule.id != 0, "Schedule does not exist");
        require(schedule.creator == msg.sender, "Not creator");
        require(schedule.status == ScheduleStatus.Pending, "Not pending");

        schedule.status = ScheduleStatus.Cancelled;

        // Refund ETH to creator
        if (schedule.value > 0) {
            (bool refundSuccess, ) = schedule.creator.call{value: schedule.value}("");
            require(refundSuccess, "Refund failed");
        }

        emit TransactionCancelled(scheduleId);
    }

    /**
     * @dev Schedule a simple token transfer
     * @param recipient Recipient address
     * @param amount Amount to send
     * @param executeAfter Execution timestamp
     * @param description Description
     * @return scheduleId Schedule ID
     */
    function scheduleTransfer(
        address payable recipient,
        uint256 amount,
        uint256 executeAfter,
        string calldata description
    ) external payable returns (uint256 scheduleId) {
        require(recipient != address(0), "Invalid recipient");
        require(executeAfter > block.timestamp, "Execution time must be in future");
        require(
            executeAfter <= block.timestamp + maxDelay,
            "Execution time too far in future"
        );
        require(
            executeAfter >= block.timestamp + minDelay,
            "Execution time too soon"
        );
        require(msg.value >= amount, "Insufficient ETH sent");

        scheduleId = nextScheduleId++;

        scheduledTransactions[scheduleId] = ScheduledTx({
            id: scheduleId,
            creator: msg.sender,
            target: recipient,
            value: amount,
            data: "0x",
            executeAfter: executeAfter,
            executeWindow: defaultWindow,
            status: ScheduleStatus.Pending,
            description: description,
            createdAt: block.timestamp,
            executedAt: 0
        });

        userSchedules[msg.sender].push(scheduleId);

        emit TransactionScheduled(
            scheduleId,
            msg.sender,
            recipient,
            executeAfter,
            description
        );

        return scheduleId;
    }

    /**
     * @dev Get all scheduled transactions for a user
     * @param user User address
     * @return scheduleIds Array of schedule IDs
     */
    function getUserSchedules(address user)
        external
        view
        returns (uint256[] memory scheduleIds)
    {
        return userSchedules[user];
    }

    /**
     * @dev Get detailed info about a scheduled transaction
     * @param scheduleId Schedule ID
     * @return schedule Full schedule details
     */
    function getSchedule(uint256 scheduleId)
        external
        view
        returns (ScheduledTx memory schedule)
    {
        return scheduledTransactions[scheduleId];
    }

    /**
     * @dev Check if a scheduled transaction is ready to execute
     * @param scheduleId Schedule ID
     * @return ready Whether the transaction can be executed now
     */
    function isReadyToExecute(uint256 scheduleId) external view returns (bool ready) {
        ScheduledTx memory schedule = scheduledTransactions[scheduleId];

        if (schedule.status != ScheduleStatus.Pending) return false;
        if (block.timestamp < schedule.executeAfter) return false;
        if (block.timestamp > schedule.executeAfter + schedule.executeWindow) return false;

        return true;
    }

    /**
     * @dev Get pending schedules count for a user
     * @param user User address
     * @return count Number of pending schedules
     */
    function getPendingSchedulesCount(address user)
        external
        view
        returns (uint256 count)
    {
        uint256[] memory schedules = userSchedules[user];
        count = 0;

        for (uint256 i = 0; i < schedules.length; i++) {
            if (scheduledTransactions[schedules[i]].status == ScheduleStatus.Pending) {
                count++;
            }
        }

        return count;
    }

    /**
     * @dev Update minimum delay (only owner)
     * @param newMinDelay New minimum delay in seconds
     */
    function setMinDelay(uint256 newMinDelay) external onlyOwner {
        require(newMinDelay > 0, "Invalid delay");
        minDelay = newMinDelay;
    }

    /**
     * @dev Update maximum delay (only owner)
     * @param newMaxDelay New maximum delay in seconds
     */
    function setMaxDelay(uint256 newMaxDelay) external onlyOwner {
        require(newMaxDelay > minDelay, "Invalid delay");
        maxDelay = newMaxDelay;
    }

    /**
     * @dev Receive ETH
     */
    receive() external payable {}

    /**
     * @dev Withdraw stuck ETH (only owner)
     */
    function withdrawETH() external onlyOwner {
        (bool success, ) = owner().call{value: address(this).balance}("");
        require(success, "Withdrawal failed");
    }
}

